import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import {Typography, Box, Grid} from '@material-ui/core';
import Navbar from '../navbar/navbar'; 
import ProjectCard from './cards/cards';

const useStyles = makeStyles(theme => ({
    mainContainer: {
        background: "#34495e",
        color: "#ecf0f1",
        textAlign: "center",
        height: '100vh'
    },
    mainHeader: {
        paddingTop: '2rem',
        paddingBottom: '1rem',
        color: "#1abc9c",
        fontSize: '2rem',
        fontWeight: 'bold'
    },
    subHeader: {
        fontSize: '2rem',
        fontWeight: 'light',
        color: "#2ecc71"
    },
    textAlignC: {
        textAlign: 'center'
    }

}))
const Projects = () => {
    const classes = useStyles();
    return (   
        <> 
        <Navbar/>
        <Box component="header" className ={classes.mainContainer}>
            <Typography className={classes.mainHeader}>Past Projects</Typography>
            <Box component ="div">
                <Typography className={classes.subHeader}>Web Development</Typography>
                {/* Here will the the different project cards */}
                <Grid container direction="column">
                    <Grid item container>
                        <Grid item xs={false} sm={2}/>
                            <Grid item xs={12}>
                                <ProjectCard/>
                            </Grid>
                            <Grid item xs={12}>
                                <ProjectCard/>
                            </Grid>
                    </Grid>
                </Grid>


            </Box>
        </Box>
        </>
        );
  }

  export default Projects;
